				original_stdout = sys.stdout
				sys.stdout = f

				print(f"N{num}[label=\"{list(node.keys())[0]}\"]")
				
				print(f"N{num}->N{tem1}[label=\"{list(tt.keys())[0]}\"]")
				print(f"N{num}->N{tem2}[label=\"{list(tt.keys())[1]}\"]")
